import Pagination from '@/components/Pagination'
import { getSubscribeList } from '@/api/subscribe'
export default {
  name: 'SubscribeList',
  components: { Pagination },
  data() {
    return {
      list: null,
      total: 0,
      listLoading: false,
      listQuery: {
        page: 1,
        limit: 20
      }
    }
  },
  created() {
    this.getList()
  },
  methods: {
    getList() {
      this.listLoading = true
      this.list = []
      getSubscribeList().then(res => {
        this.listLoading = false
        if (res.code === 200) {
          this.list = res.data
        }
      })
    }
  }
}
